cars.description:
Vi välkomnar helt nya Opel Vivaro, ett välkomnat tillskott med modernare utseende och nya funktioner. 

Varmt Välkomna att kontakta Algot.kjellsson@kronobergsbil.se eller 0470-71 91 12 för mer information, frågor eller finansieringsupplägg. 

Vi erbjuder ett komplett transportbilscenter med ombyggnationer från inredning, belysning och dekor.


ELITE Utrustning; 10tum digitalt förarkluster; 10tum touchscreen, Radio, DAB, Apple CarPlay, Bluetooth & USB; 17tum stålfälgar, hel navkapsel (Kan ej kombineras med speciallack); Automatisk klimatanläggning inkl. kylbart handskfack; Dödavinkelvarnare; Elektrisk parkeringsbroms; Elinfällbara sidospeglar; Flankguard; Full Eco LED strålkastare; Hellackerad kaross (Backspeglar i Svart Perla Nera, LED - varselljus och dimstrålkastare (Kan ej kombineras med speciallack); Keyless, nyckelfritt lås- och startsystem; Moduwork, uppfällbart passagerarsäte (0,5m3 extra lastvolym); Parkeringssensorer bak; Parkeringssensorer fram; Surround View (Kamera med två vinklar); Trådlös mobilladdare; 
12V-uttag i kupé och i lastutrymmet; Fästöglor i golvet, 6st L2 och 8st L3; Komfortmellanvägg med fönster samt lastlucka; Skyddsinklädnad väggar och golv; Utökad lastkapacitet
17tum Stålfälgar, 215/60 R17;
180° öppningsbara bakdörrar; Höger sidoskjutdörr; 
ABS(låsningsfria bromsar); AEBS (Advanced Emergency braking system); Airbag förare och passagerare samt sidoairbags; Däcktrycksensor TPMS; EBA(nödbromsassistans); Elektronisk startspärr; ESP(antisladdsystem) med ASR(antispinnsystem); Filhållningsassistans; Helljusassistent; Hill assist(hjälp vid start i backe); Högt placerat bromsljus; Nackskydd justerbara i höjd; Regnsensor; Trafikskyltsavläsning; Trepunktsbälten på samtliga platser; VAEB (Videoassisterad Autobroms); 
Bältesvarnare; Digital serviceindikator; Trötthetsvarnare;
Elhissar fram med puls- och klämskyddsfunktion; Eljusterbara sidospeglar med defroster; Farthållare och fartbegränsare; Fjärrstyrt centrallås för kupé och lastutrymme; Höj- och sänkbart samt skjutbart förarsäte med armstöd samt svankstöd; Passagerarsoffa med två sittplatser; Ratt inställbar i höjd- och djupled; Servostyrning; Uppvärmd läderklädd multifunktionsratt; Uppvärmt förarsäte och yttre passagerarsäte; 
Extra förvaringsfack i dörrar, 8,3 L; Förvaringsfack i dörrar, 1,5 L; Förvaringsfack placerat på instumentbrädans ovansida, 5,4 L; Förvaringsfack under radio, 0,5 L; 

3 års fabriksgaranti/10000mil. 3 års assistans. 5 års genomrostningsgaranti. 3 års
lackgaranti. 1 års garanti på eftermonterat tillbehör.
